import React, { useState } from 'react';
import './App.css';

function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');

  return (
    <div className="relative min-h-screen flex flex-col justify-center items-center bg-cover bg-center bg-fixed" style={{ backgroundImage: "url('/rec.jpeg')" }}>
      <div className="relative z-10 mb-8">
        
        <img src="/logo2.png" alt="Rajalakshmi Engineering College" className="w-32 lg:w-48" />
      </div>
      <div className="relative z-10 bg-purple-500 p-6 rounded-lg shadow-lg max-w-sm w-full mx-4 transition-transform transform hover:scale-105">
        <h1 className="text-2xl font-bold mb-4 text-white text-center">Register Page</h1>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-4">
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-4">
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <button className="w-full bg-white text-purple-500 p-2 rounded hover:bg-purple-50 focus:outline-none">Register</button>
      </div>
    </div>
  );
}

export default RegisterPage;
